window.bookSummaryJSON = "<p>Best-selling author John Ringo—a former member of the elite 82nd Airborne Division—and real-life rocket scientist Travis S. Taylor bring an unmatched level of authenticity to their action-packed military science fiction.</p> <p> <i>Claws That Catch</i> is the fourth volume from their popular Looking Glass series. Humankind’s only interstellar craft, the Vorpal Blade is dispatched to investigate an ancient civilization that may have left vital technology behind. But when the crew finds more than they bargained for, they’ll have to scramble to survive.</p>"; 
